import React from 'react';
import { LogOut, User } from 'lucide-react';

const Navbar: React.FC = () => {
  const handleLogout = () => {
    // TODO: Implement logout functionality
    console.log('Logout clicked');
  };

  return (
    <div className="h-16 bg-background border-b border-gray-700 flex items-center justify-between px-6">
      {/* Left side - Page title */}
      <div className="flex items-center space-x-4">
        <h2 className="text-xl font-semibold text-white">Dashboard</h2>
      </div>

      {/* Right side - User info and logout */}
      <div className="flex items-center space-x-4">
        <div className="flex items-center space-x-2 text-gray-300">
          <User className="w-4 h-4" />
          <span className="text-sm">John Doe</span>
        </div>
        
        <button
          onClick={handleLogout}
          className="flex items-center space-x-2 px-3 py-2 text-gray-300 hover:text-white hover:bg-gray-700 rounded-lg transition-colors"
        >
          <LogOut className="w-4 h-4" />
          <span className="text-sm">Logout</span>
        </button>
      </div>
    </div>
  );
};

export default Navbar;
